import React from "react";
import { Box, Typography, Button, Grid } from "@mui/material";

export default function NoTours({fetchTours}) {
    return (
        <Grid container >
        <Typography
        variant="h2"
        sx={{
          display: "inline",
          textDecoration: "underline hsl(205, 78%, 60%)",
        }}
      >
        No tours left
      </Typography>
      <Button
          sx={{
            color: "hsl(360, 67%, 44%)",
            width: "60%",
            textTransform: "none",
            fontWeight: "bold",
            backgroundColor: "white",
            
            marginTop: 2,
            borderColor: "hsl(360, 67%, 44%)",
            "&:hover": {
              backgroundColor: "#CF7095",
            },
          }}
          variant="outlined"
            onClick={fetchTours}
        >
          Refresh
        </Button>
        </Grid>
    );
}
